import React from 'react';
import Button from '../Button/Button';
import classes from './GroupHeader.module.css';

const GroupHeader = () => {
    return (
        <div className={classes.header}>
            <div className={classes.cover}>
                {/* Здесь будет обложка группы */}
                <div className={classes.coverPlaceholder}></div>
            </div>
            <div className={classes.info}>
                <h1 className={classes.title}>Tech Enthusiasts Group</h1>
                <div className={classes.meta}>
                    <span className={classes.members}>15.2K members</span>
                    <span className={classes.type}>Public Group</span>
                </div>
                <div className={classes.actions}>
                    <Button white>Follow</Button>
                    <Button>Join Group</Button>
                </div>
            </div>
        </div>
    );
};

export default GroupHeader;
